(let [conn  (nr/connect "http://neo4j:h2ll0go@localhost:7474/db/data/")
        jeff   (nn/create conn {:username "jtcummi"})
        wanda   (nn/create conn {:username "wanda"})
        rel   (nrl/create conn jeff wanda :friend {:source "college"})]
    (println rel))
